import React from "react";
import "./App.css";
import DivBlock from "./componets/DivBlock";

class App extends React.Component {
  state = {
    blocks: [{ list: [1, 2, 3, 4] }],
    nullTracker: 15,
  };

  render() {
    return (
      <div>
        <DivBlock blocks={this.state.blocks.row} />
      </div>
    );
  }
}

export default App;
